import React from 'react'
import Item from './Item'

export default function Items(item, onAdd) {
  let data = item.items
  return (
    <main>

      {data.map((el => (
        <Item 
        key={el.id} data={el} addItem={onAdd}/>
      )))}
    </main>
  )
}
